        AS SELECT {{query_result_text}}, CAST({{ column_name }} AS {{new_column_type}}) AS {{column_name}} FROM {{ relation.schema }}.{{ relation.identifier }}
        {{ apply_label() }}
    {% endset %}

    {% call statement('create_temp_table') -%}
