{% set pruned_cols = [column_name] %}

{% if group_by_columns|length() > 0 %}

  {% set select_gb_cols = group_by_columns|join(' ,') + ', ' %}
  {% set groupby_gb_cols = 'group by ' + group_by_columns|join(',') %}
  {% set pruned_cols = group_by_columns %}

  {% if column_name not in pruned_cols %}
    {% do pruned_cols.append(column_name) %}
  {% endif %}

{% endif %}

{% set select_pruned_cols = pruned_cols|join(' ,') %}

select *
from (
    with pruned_rows as (
      select
        {{ select_pruned_cols }}
      from {{ model }}
      {% if group_by_columns|length() == 0 %}
        where {{ column_name }} is not null
        limit 1
      {% endif %}
    )
    select
        {# In TSQL, subquery aggregate columns need aliases #}
        {# thus: a filler col name, 'filler_column' #}
      {{select_gb_cols}}
      count({{ column_name }}) as filler_column

    from pruned_rows

    {{groupby_gb_cols}}

    having count({{ column_name }}) = 0

) validation_errors

{% endmacro %}

macro.dbt_utils.default__get_url_path.macro_sql:
{% macro default__get_url_path(field) -%}

    {%- set stripped_url =
        dbt.replace(
            dbt.replace(field, "'http://'", "''"), "'https://'", "''")
    -%}

    {%- set first_slash_pos -%}
        coalesce(
            nullif({{ dbt.position("'/'", stripped_url) }}, 0),
            {{ dbt.position("'?'", stripped_url) }} - 1
            )
    {%- endset -%}

    {%- set parsed_path =
        dbt.split_part(
            dbt.right(
                stripped_url,
                dbt.length(stripped_url) ~ "-" ~ first_slash_pos
                ),
            "'?'", 1
            )
    -%}

    {{ dbt.safe_cast(
        parsed_path,
        dbt.type_string()
    )}}

{%- endmacro %}

macro.dbt_utils.default__get_url_host.macro_sql:
{% macro default__get_url_host(field) -%}

{%- set parsed =
    dbt.split_part(
        dbt.split_part(
            dbt.replace(
                dbt.replace(
                    dbt.replace(field, "'android-app://'", "''"
                    ), "'http://'", "''"
                ), "'https://'", "''"
            ), "'/'", 1
        ), "'?'", 1
    )

-%}


    {{ dbt.safe_cast(
        parsed,
        dbt.type_string()
        )}}

{%- endmacro %}

macro.dbt_utils.default__get_url_paramet.macro_sql:
{% macro default__get_url_parameter(field, url_parameter) -%}

{%- set formatted_url_parameter = "'" + url_parameter + "='" -%}

{%- set split = dbt.split_part(dbt.split_part(field, formatted_url_parameter, 2), "'&'", 1) -%}

nullif({{ split }},'')

{%- endmacro %}
